import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import start_page from "./components/start_page";


class App extends React.Component {
    render() {
        return (
            <BrowserRouter>
                <div>
                    <navigation />
                    <Switch>
                        <Route path="/" component={start_page} exact/>
                        <Route path="/problem" component={problem}/>
                    </Switch>
                </div>
            </BrowserRouter>
        )
    }
}

ReactDOM.render(<App />, document.getElementById('root'));

class Header extends React.Component {
    render() {
        return (

                <div className="w3-bar w3-black  w3-card" id="myNavbar">
                    <a href="/" className="w3-bar-item"
                       style={{padding: '8px 16px', fontfamily: 'Gloria Hallelujah', fontweight: 100, fontsize: 'x-large',  textdecoration: 'none'}}>
                        astro-problems
                    </a>





                </div>

        )
    }
}

ReactDOM.render(<Header />, document.getElementById('header'))
